import React from 'react';
import c from './Catalog.module.scss';
export const CatalogItem = ({ mobile, title }) => {
  return (
    <div className={c.catalogItem}>
      <div className={c.catalog__inner}>
        <div className={mobile ? `${c.title} ${c.mobile}` : `${c.title}`}>
          {title}
        </div>
      </div>
    </div>
  );
};
